A Prairie Home Companion, March 29, 2014 Show #1439 Keep it Clean

Coming to you this week from The Fitzgerald Theater in Saint Paul, it's a live broadcast of A Prairie Home Companion with Garrison Keillor. With special guests, folksinger Willie Watson, soul siblings Jearlyn and Jevetta Steele, singer Hilary Thavis, and pianist and clarinetist Butch Thompson. Plus, the Royal Academy of Radio Actors, Tim Russell, Sue Scott, and Fred Newman, The Guy's All-Star Shoe Band, and the latest News from Lake Wobegon.
